import React from 'react'
import style from './BodyBlock.module.css';

function BodyBlock() {

    return(
        <div className={style.body}>
            <div>
                <ul>
                    <li>Normal</li>
                    <li>Good</li>
                    <li>Bu</li>
                    <li>Good</li>
                    <li>Good</li>
                </ul>
            </div>
        </div>
    )
}

export default BodyBlock;
